class GetRF extends Component {
	constructor(props) {
	  super(props);
	  this.state = {
		  error: null,
		  isLoaded: false,
		  items: {}
	  };
	  this.toogleBtnRF = this.props.toogleBtnRF.bind(this);
	}

	componentDidMount() {
		fetch("http://monitoring.geosafer-mindanao.org/rainfall/getRF_data.php?dev_id="+this.props.dev_id)
		  .then(res => res.json())
		  .then(
			(result) => {
			  if(result.dev_id){
				  this.toogleBtnRF();
				  this.setState({
					isLoaded: true,
					items: result
				  });					 
			  }else{
				  this.setState({
					isLoaded: true,
					items: result,
					error : "Unable"
				  });
			  }
			},
			(error) => {
			  this.setState({
				isLoaded: true,
				error
			  });
			}
		  )
	  }

		
	  componentWillReceiveProps(newProps){
		  if(newProps.dev_id !== this.props.dev_id){
			  this.setState({
					error: null,
					isLoaded: false,
					items: {}				
			  });
			  fetch("http://monitoring.geosafer-mindanao.org/rainfall/getRF_data.php?dev_id="+ newProps.dev_id)
			  .then(res => res.json())
			  .then(
				(result) => {				  
				  if(result.dev_id){
					  this.toogleBtnRF();
					  this.setState({
						isLoaded: true,
						items: result
					  });					 
				  }else{
					  this.setState({
						isLoaded: true,
						items: result,
						error : "Unable"
					  });
				  }
				  
				},
				(error) => {
				  this.setState({
					isLoaded: true,
					error
				  });
				}
			  )
		  }

	  }
	  
	 
	render() {
		const { error, isLoaded, items } = this.state;
		
		if (error) {
		  return (
			<Alert bsStyle="danger" style={alertMargin}>
			  <h4>An error has occured!</h4>
			  <p>
				Unable to access server as of the moment. Please try again later.
			  </p>
			</Alert>
		  )
		} else if (!isLoaded) {
		  return <div>Loading...</div>;
		} else {
			
			const rfdata = items.data.map(item => item.rain_value);
			const rfdata_len = rfdata.length;
			const rainVal = items.data;
			let  latest_rainval;
			if(rfdata_len > 0){
				latest_rainval = parseFloat(rainVal[rfdata_len - 1]['rain_value'] * 4);
				let rain_data = [];
				let firstDate;//, llastDate;
				let accum = 0;
				let getIndex = 0,
					diffHours = 0;
				for (let k = 0; k < rfdata_len; k++) {
					let lastDate = rainVal[rfdata_len- k - 1]['dateTimeRead'];
					firstDate = rainVal[rfdata_len - 1]['dateTimeRead'];
					diffHours = (Math.abs(lastDate - firstDate) / 36e5) * 1000;
					if ((diffHours >= 23) && (diffHours <= 24)) {
						getIndex = parseInt(rainVal.length - k - 1,0);

					}
				}
				for (let i = getIndex; i < rfdata_len; i++) {
					//llastDate = rainVal[getIndex]['dateTimeRead'];
					let dateTimeRead = parseInt(rainVal[i]['dateTimeRead'] + 28800, 0) * 1000;
					let rain_values = parseFloat(rainVal[i]['rain_value'],2);
					parseFloat(accum += rainVal[i]['rain_value']);
					rain_data.push([dateTimeRead,rain_values])
				}
				let asof = (firstDate + 28800) * 1000;
				let asof1 = Highcharts.dateFormat("%b %e, %Y %I:%M %p", asof);
				rf_data.data = rain_data;
				rf_data.dev_id = items.dev_id;
				rf_data.location = items.location;
				rf_data.municipality = items.municipality;
				rf_data.province = items.province;
				rf_data.latest_date = asof1;
				rf_data.accum24 = parseFloat(accum.toFixed(2),0);
			}else{
				rf_data.location = items.location;
				rf_data.municipality = items.municipality;
				rf_data.province = items.province;
			}
			
			
		  return (
		  <div className="result">
				 {rfdata_len > 0
					? 
					<div>
						<p><strong> <i>{rf_data.location}, {rf_data.municipality}, {rf_data.province} </i></strong></p>
						<span> 	
							 <p>Rainfall Amount as of {rf_data.latest_date} :<strong> {latest_rainval.toFixed(2)} mm./hr </strong></p>
							 <p>Total Accumulated Rainfall Amount: <strong> {rf_data.accum24} mm </strong></p>
						 </span>
					</div>:
					 <p><strong>No Data</strong></p>
					 
				 }
		  </div>
		  );
		}
	}
}

